import React, { Component } from 'react';

class App extends React.Component {
   constructor(props) {
      super(props);
      this.state = {
         posts: [],
         isShareModalOpen: false,
         shareTitle: '',
         shareOrigin: '',
         shareURL: '',
         cardExpanded: false,
         cardIdentifierentifier: '',
         expandedCardContent: {},
         searchQuery: ''
      };
      this.props = {
         currentPage: '',
         searchQuery: '',
         currentOrigin: '',
         location: '',
         match: ''
      }

   }

   render() {
      return <Navbar location={this.props.location} />
   }
}

const SearchPage = ({ match, location }) => {
   return (
      <>
         <p>
            <strong>Location Props: </strong>
            {JSON.stringify(location, null, 2)}
         </p>
         <p>
            <strong>Query Param: </strong>
            {location.search}
         </p>
      </>
   );
}

export default SearchPage;
